import React from 'react';

class ListItems extends Component {
    items = this.props.items;
    listItems = items.map(item => {
        return <div className="list" id={item.id}>
            <p>{item.content}</p>
        </div>
    });
    render() {
        return (
            <div>{listItems}</div>
        )
    }
}

export default ListItems
